      re = /startquestion-widget-\d+?=.+?lastViewDate"%3A(\d+?)}/g;
      var lastViewDates = [],
      matches = allCookies.match(re);

      while ((match = re.exec(allCookies)) != null) {
        lastViewDates.push(match[1]);
      }

      if (lastViewDates) {
         var lastViewDateInt = Math.max.apply(null, lastViewDates),
         lastViewDate = new Date(lastViewDateInt),
         milisecondsFromToday = (new Date() - lastViewDate),
         daysFromToday = Math.round(milisecondsFromToday / 1000 / 60 / 60 / 24);
         if (!isNaN(daysFromToday) && daysFromToday<10000)
           return daysFromToday; // return how many days lasted from the last seeing of a SQ widget        
      }
